import React, { useState } from "react";

import { Document, Page, PDFViewer, View, StyleSheet, Font } from '@react-pdf/renderer';

import { SignatureCard, SignatureCard2 } from "../../components/SignatureCard";
import { HeaderBackground, HeaderBackground2 } from "../../components/HeaderBackground";
import { HeaderLogo, HeaderLogo2 } from "../../components/HeaderLogo";
import { CardTitle, CardTitle2 } from "../../components/CardTitle";
import { ContentCard, ContentCard2 } from '../../components/ContentCard';
import { FooterBackground, FooterBackground2 } from "../../components/FooterBackground";
import { FooterText, FooterText2 } from '../../components/FooterText';
import { DetailsContent, DetailsContent2 } from "../../components/DetailsContent";

let textoExemplo = "Certificamos que o Sr. LUCYLENE MOURA DE MENEZES da empresa COMERCIAL BAHIA, concluiu a curso de BRIGADA EMERGENCIAL em conformidades com a NR 23 (Norma Regulamentadora Nº 23 - Proteção contra incêndios regulamentada pela port. do Mb nº 3.214, de 8-6-1978), realizado nos dias 20 e 21/01/2022 com carga horária de 16 horas no total."
let enderecoExemplo = "Rua Antonio Sansone, 335 - José Bonifacio - SP"
export function CertificadoPdf() {
    const [typeHeader, setTypeHeader] = useState('Logo');
    const [typeFooter, setTypeFooter] = useState('Texto');
    const [headerBackground, setHeaderBackground] = useState('');
    const [footerBackground, setFooterBackground] = useState('');
    const [verso, setVerso] = useState(false);
    const [headerLogo, setHeaderLogo] = useState({
        logo: '',
        style: {
            justifyContent: 'flex-start',
            backgroundColor: '#000'
        }
    })
    const [contentTitle, setContentTitle] = useState({
        title: 'Certificado',
        textStyle: {
            fontSize: 40,
            fontWeight: 'bold',
            textAlign: 'center',
            fontFamily: "NunitoRegular",
            color: '#657176'
        }
    })
    const [contentFooter, setContentFooter] = useState({
        text: 'https://4learn.softensistemas.com.br/empresateste/certificado/45645361321321',
        backgroudColor: '#000',
        textStyle: {
            fontSize: 15,
            fontFamily: "NunitoRegular",
            color: "#657176",
            textAlign: 'center',
        },
    })

    const [signatures, setSignatures] = useState([
        {
            img: '',
            label: 'Aluno'
        }
    ])

    const [contentVerso, setContentVerso] = useState({
        title: "Conteúdo programatico",
        details: "Descrição",
        titleStyle: {
            textAlign: 'left',
            fontSize: 25,
            fontFamily: "NunitoRegular",
            fontWeight: 'bold',
            color: "#000"
        },
        detailsStyle: {
            textAlign: 'justify',
            fontSize: 20,
            fontFamily: "NunitoRegular",
            color: "#657176"
        }
    })

    const [contentDescription, setContentDescription] = useState({
        description: textoExemplo,
        address: enderecoExemplo,
        color: '#657176',
        descriptionStyle: {
            fontSize: 17,
            fontFamily: "NunitoRegular",
            textAlign: 'justify'
        },
        addressStyle: {
            fontSize: 17,
            fontFamily: "NunitoRegular",
            textAlign: 'justify'
        }


    })


    return (
        <div className="App">
            <div className='containerCertificado'>

                <div className="certificado">
                <PDFViewer className="iframe-pdf">

                    {!verso ?
                        <>
                            <ul>
                                <li className='certificado-topo'>
                                    {typeHeader === 'Background' ?
                                        <HeaderBackground2 img={headerBackground} /> :
                                        <HeaderLogo2 headerLogo={headerLogo} />
                                    }
                                </li>

                                <li className='certificado-conteudo'>
                                    <div>
                                        <CardTitle2 contentTitle={contentTitle} />
                                        <ContentCard2
                                            contentDescription={contentDescription}
                                        />
                                    </div>
                                    <div className="containerAssignatures">
                                        {signatures.map((index, indice) => (
                                            <SignatureCard2 signature={index} key={indice} />
                                        ))}
                                    </div>
                                </li>

                                <li className='certificado-footer'>
                                    {typeFooter === 'Background' ?
                                        <FooterBackground2 img={footerBackground} /> :
                                        <FooterText2 contentFooter={contentFooter} />
                                    }
                                </li>
                            </ul>
                        </>
                        :
                        <>
                            <ul>
                                <li className='certificado-verso'>
                                    <DetailsContent2 contentVerso={contentVerso} />
                                </li>
                            </ul>
                        </>
                    }
                    </PDFViewer>

                </div>

            </div>

        </div>
    )
}
